import styled from 'styled-components';

export const Container= styled.div `
 position:relative ;
 left:5%;
 width:90%;
 height: 600px;
 background-color: #333;
`;
export const Cardprof = styled.div`
  width:300px;
  height: 150px;
  background-size:cover;

`;

export const CardInfo = styled.div`
 position: relative;
 left:10px;
 bottom:35px;
 background-color:#f1f1f1;
 width:280px;
 height: 250px;

 img{
     position: relative;
     bottom: 80px;
     left: 25%;
     width:100px;
     height: 100px;
     border-radius: 50%;
 }
 p{
     font-family: 'Hina Mincho';
     text-align: center;
 }
 h2{
     font-family: 'Hina Mincho';
     text-align: center;
 }
 h4{
     font-family: 'Hina Mincho';
     text-align: center;
 }
`;
